p: $spacing-base-tight; // \u56fe\u6807\u6309\u94ae\u9876\u90e8\u5185\u8fb9\u8ddd - \u5927\u5c3a\u5bf8\n$spacing-button_iconOnly_large-paddingBottom: $spacing-base-tight; // \u56fe\u6807\u6309\u94ae\u5e95\u90e8\u5185\u8fb9\u8ddd - \u5927\u5c3a\u5bf8\n$spacing-button_iconOnly_small-paddingLeft: $spacing-extra-tight; // \u56fe\u6807\u6309\u94ae\u5de6\u4fa7\u5185\u8fb9\u8ddd - \u5c0f\u5c3a\u5bf8\n$spacing-button_iconOnly_small-paddingRight: $spacing-extra-tight; // \u56fe\u6807\u6309\u94ae\u53f3\u4fa7\u5185\u8fb9\u8ddd - \u5c0f\u5c3a\u5bf8\n$spacing-button_iconOnly_small-paddingTop: $spacing-extra-tight; // \u56fe\u6807\u6309\u94ae\u9876\u90e8\u5185\u8fb9\u8ddd - \u5c0f\u5c3a\u5bf8\n$spacing-button_iconOnly_small-paddingBottom: $spacing-extra-tight; // \u56fe\u6807\u6309\u94ae\u5e95\u90e8\u5185\u8fb9\u8ddd - \u5c0f\u5c3a\u5bf8\n\n// margin\n$spacing-button_iconOnly_content-marginLeft: $spacing-tight; // \u6309\u94ae\u5de6\u4fa7\u56fe\u6807\u8ddd\u79bb\u6587\u5b57\u95f4\u8ddd\n$spacing-button_iconOnly_content-marginRight: $spacing-tight; // \u6309\u94ae\u53f3\u4fa7\u56fe\u6807\u8ddd\u79bb\u6587\u5b57\u95f4\u8ddd\n\n$font-button-fontWeight: $font-weight-bold; // \u6309\u94ae\u6587\u5b57\u5b57\u91cd\n$height-button_large: $height-control-large; // \u6309\u94ae\u9ad8\u5ea6 - \u5927\u5c3a\u5bf8\n$height-button_small: $height-control-small; // \u6309\u94ae\u9ad8\u5ea6 - \u5c0f\u5c3a\u5bf8\n$height-button_default: $height-control-default; // \u6309\u94ae\u9ad8\u5ea6 - \u9ed8\u8ba4\n\n$width-button-border: $border-thickness; // \u6309\u94ae\u63cf\u8fb9\u5bbd\u5ea6\n$radius-button: var(--semi-border-radius-small); // \u6309\u94ae\u5706\u89d2\u5927\u5c0f\n$radius-button_group: $radius-button; // \u6309\u94ae\u7ec4\u5706\u89d2\u5927\u5c0f\n$width-button-outline: 2px; // \u6309\u94ae\u8f6e\u5ed3\u5bbd\u5ea6\n","@import \"~@semi-bot/semi-theme-universedesign/scss/index.scss\";\n$prefix: 'semi';\n@import './variables.scss';\n@import \"~@semi-bot/semi-theme-universedesign/scss/local.scss\";\n@import './splitButtonGroup.scss';\n\n$module: #{$prefix}-button;\n\n.#{$module} {\n    @include shadow-0;\n    @include font-size-regular;\n    height: $height-button_default;\n    display: inline-flex;\n    align-items: center;\n    justify-content: center;\n    margin: 0;\n    cursor: pointer;\n    user-select: none;\n    border: $width-button-border $color-button_primary-border-default solid;\n    border-radius: $radius-button;\n    padding-left: $spacing-button_default-paddingLeft;\n    padding-right: $spacing-button_default-paddingRight;\n    padding-top: $spacing-button_default-paddingTop;\n    padding-bottom: $spacing-button_default-paddingTop;\n    font-weight: $font-button-fontWeight;\n    outline: none;\n    vertical-align: middle;\n    white-space: nowrap;\n\n    // the specificity of `.#{$module}:focus-visible`  may lower than `reset.css` default `focus-visible` style\n    // so we add a class at the same level\n    &.#{$module}-primary,\n    &.#{$module}-secondary,\n    &.#{$module}-tertiary,\n    &.#{$module}-warning,\n    &.#{$module}-danger {\n        &:focus-visible {\n            outline: $width-button-outline solid $color-button_primary-outline-focus;\n        }\n    }\n\n    &-danger {\n        background-color: $color-button_danger-bg-default;\n        color: $color-button_danger-text-default;\n        &:hover {\n            background-color: $color-button_danger-bg-hover;\n        }\n        &:active {\n            background-color: $color-button_danger-bg-active;\n        }\n        &.#{$module}-light,\n        &.#{$module}-borderless {\n            color: $color-button_danger_borderless-text-default;\n        }\n        &:not(.#{$module}-borderless):not(.#{$module}-light):focus-visible {\n            outline: $width-button-outline solid $color-button_danger-outline-focus;\n        }\n    }\n    &-warning {\n        background-color: $color-button_warning-bg-default;\n        color: $color-button_warning-text-default;\n        &:hove